import React from 'react';
import '../CSS/NavBar.css';
import { NavLink } from 'react-router-dom';

const NavBar = () => {
  return (
    <div className='nav-bar'>
      <img/>
      <div>
        <NavLink exact to="/">
          Home
         </NavLink>
         <NavLink exact to="/Form">
           Add New Course
          </NavLink>
      </div>
      <p>NavBar</p>
    </div>
  )
}
export default NavBar;
